    return slice.data.map(({name, value}) => ({label: name, value}));
});

export const cuisinesFiltersSelector = state => _cuisineAutocompleteSliceSelector(state).filters;
export const cuisinesLoadingSelector = state => _cuisineAutocompleteSliceSelector(state).loading;
